// Debug utility to check button functionality
export const debugButtonClick = (buttonName) => {
  console.log(`Button clicked: ${buttonName}`);
};

// Add click event listener to all buttons for debugging
export const addButtonDebugListeners = () => {
  document.addEventListener('click', (e) => {
    if (e.target.tagName === 'BUTTON') {
      console.log('Button clicked:', e.target.textContent, e.target);
    }
  });
};
